import React, {Component} from 'react';
import {getCV} from "../api/apiCalls";


class  Item extends Component{
    state ={
        name: undefined
    }

    componentDidMount() {
        this.setState({
            name: this.props.cv.name
        })
    }

    render(){
        const {name} =this.state;
        return(
            <div>{name}</div>
        )
    }
}

class CvList extends Component {



    state = {
        cvs: []
    };

    componentDidMount() {
        getCV().then(response => {
            this.setState({
                cvs: response.data.content
            });
        });
    }

    render() {
        const {cvs} = this.state;
        return (
            <div>
                {cvs.map((cv,index) => {
                    return (
                        <Item key={index} cv={cv}/>
                    );
                })}
            </div>
        );
    }
}

export default CvList;
